vector < ll > vec;

map < pair < ll , ll > , ll  > dp;



ll ans =0 , n ;

ll rec(int idx , int cnt ){
    if(idx >= n ) return INT_MAX;
    
    if(idx == n-1 ){   
        if(cnt >= 2   ) 
            return vec[idx]-vec[idx-cnt] ; 
        return INT_MAX ;
    }

    if(dp.find({idx , cnt}) != dp.end()) 
        return dp[{idx , cnt}] ;



     ll ret =dp[{idx , cnt}] = INT_MAX;
    ret = min(ret , rec(idx+1 , cnt+1));
    
    if(cnt >= 2){
        ret = min(ret , vec[idx] - vec[idx-cnt] + rec(idx+1 , 0));
    }
    
    
    return dp[{idx , cnt}] = ret ;
}



