public interface ILogger
{
    public void WriteError(string message);
}

public class Pathfinder
{
    private ILogger _logger;

    public Pathfinder(ILogger logger)
    {
        _logger = logger;
    }

    public void Find()
    {
        _logger.WriteError("Путь не найден!");
    }
}

public class ConsoleLogWritter : ILogger
{
    public void WriteError(string message)
    {
        Console.WriteLine(message);
    }
}

public class FileLogWritter : ILogger
{
    public void WriteError(string message)
    {
        File.WriteAllText("log.txt", message);
    }
}

public abstract class Friday : ILogger
{
    private ILogger[] _loggers;

    public Friday(params ILogger[] loggers)
    {
        _loggers = loggers;
    }

    public void WriteError(string message)
    {
        if (DateTime.Now.DayOfWeek == DayOfWeek.Friday)
        {
            foreach (var logger in _loggers)
            {
                logger.WriteError(message);
            }
        }
    }
}

public class FridayConsoleLogWritter : Friday
{
    public FridayConsoleLogWritter() : base(new ConsoleLogWritter()) { }
}

public class FridayFileLogWritter : Friday
{
    public FridayFileLogWritter() : base(new FileLogWritter()) { }
}

public class FridayConsoleAndFileLogWriter : Friday
{
    public FridayConsoleAndFileLogWriter() : base(new ConsoleLogWritter(), new FileLogWritter()) { }
}

