// function to get ip address

#include <stdio.h>
#include <string.h> 
#include <sys/socket.h>
#include <arpa/inet.h>
#include <netdb.h>


int main(int argc, char* argv[]){
    char* host ="www.google.com";
    char ip[100];

    struct hostent *x;
    struct in_addr **addrlist;
    int i;

    if((x = gethostbyname(host))==NULL){
        printf("gethostbyname failed");
        return 1;
    }

    addrlist = (struct in_addr**) x->h_addr_list;

    for(i=0; addrlist[i]!=NULL; i++){
        strcpy(ip, inet_ntoa(*addrlist[i]));
    }

    printf("%s resolved to : %s" , host, ip);
	return 0;
}

