// server socket

#include <stdio.h>
#include <string.h> 
#include <sys/socket.h>
#include <arpa/inet.h>
#include <netdb.h>

int main(int argc, char*argv[]){
    int socket1, socket2;
    struct sockaddr_in server, client;

    socket1 = socket(AF_INET, SOCK_STREAM, 0);
    if(socket1 == -1){
        printf("socket error");
    }

    server.sin_family = AF_INET;
    server.sin_addr.s_addr = INADDR_ANY;
    server.sin_port = htons(8888);

    if(bind(socket1, (struct sockaddr*)&server, sizeof(server))<0){
        printf("bind fail");
    }

    printf("bind success");

    listen(socket1, 3);

    printf("waiting");

    int p = sizeof(struct sockaddr_in);
    socket2=accept(socket1, (struct sockaddr*)&client, (socklen_t*)&p);
    if(socket2<0){
        printf("accept fail");
    }

    printf("accept success");

    return 0;

}

